package progimg

import (
	"net/http"
	"net/http/httptest"
	"net/url"
	"strings"
	"testing"
)

func Test_uploadImage_base64(t *testing.T) {
	form := url.Values{}
	form.Add("type", "base64")
	form.Add("content-type", "image/png")
	form.Add("image", "")
	r := httptest.NewRequest("POST", "/images", strings.NewReader(form.Encode()))
	r.Header.Add("Content-Type", "application/x-www-form-urlencoded")
	w := httptest.NewRecorder()
	handleUpload(w, r)
	if w.Code != http.StatusCreated {
		t.Fatalf("unexpected error: %v", w)
	}
}

func Test_uploadImage_base64_error(t *testing.T) {
	form := url.Values{}
	form.Add("type", "base64")
	form.Add("image", "")
	r := httptest.NewRequest("POST", "/images", strings.NewReader(form.Encode()))
	r.Header.Add("Content-Type", "application/x-www-form-urlencoded")
	w := httptest.NewRecorder()
	handleUpload(w, r)
	if w.Code != http.StatusBadRequest {
		t.Fatalf("unexpected error: %v", w)
	}
}
